import axios from 'axios'


export const fetchPackages = async () => {
    try {
        const response = await axios.get(`https://data.jsdelivr.com/v1/stats/packages`)
        return response.data
    } catch (error) {
        console.error('Error fetching packages:', error)
        throw error
    }
}
